import React from "react";
import { PopupWidget } from "react-calendly"

class Calender extends React.Component {
  render() {
    return (
      <div id='home'>
        <PopupWidget
           color="#00a2ff"
           text=" קבעי תור עכשיו"
           textColor="#ffffff"
           url="https://calendly.com/your-username"
        />
      </div>
    );
  }
}

export default Calender;
